css:
.atom-shortcuts {
  color: #9b9b9b;
  font-size: 10px;
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  margin: 3%;
  padding: 10px;
  background-color: #373737;
  z-index: 3;
  border: 1px solid #282828;
}
.atom-shortcuts .left {
  float: left;
}
.atom-shortcuts .item {
  border: 1px solid #9b9b9b;
  border-bottom: 0;
  padding: 5px;
}
.atom-shortcuts .item p {
  margin: 0;
  padding: 0;
}
.atom-shortcuts .item-last {
  border-bottom: 1px solid #9b9b9b;
}
.atom-shortcuts .one-third {
  width: 33.3%;
}
.atom-shortcuts .section {
  padding: 5px;
  border-bottom: 0;
}
.atom-shortcuts .section h2 {
  margin: 0;
  padding: 5px 0;
}
